import React from 'react';
import { Signin } from './signin';


export class Dash extends React.Component
{

    constructor(props)
    {
        super(props)
        this.state={
            loggedin:false,uname:"Amrutha"
        }
    }
    
    render(){
        return(
            <div>
               {
                this.state.loggedin?
                <>
                <h2>Welcome</h2>
                <button>Logout</button>
                </>:
                <>
                <h2>Please sign in !</h2>
                <Signin></Signin>
                </>
               } 
            </div>
        )
    }
}
